import React, { useCallback } from 'react';
import './App.css';
import Home from './Home'
import { BrowserRouter as Router, Routes, Route, Switch } from 'react-router-dom';
function App() {
    return (
    <Router>
      <Switch>
        <Route path="/" exact component={Home} />
      </Switch>
    </Router>
    );
}

export default App;
